    height: 225px;
    background-color: orange;
    box-shadow: none;
`
const Component = styled(Container)`
    height = 100%;
    background-color: orange;
`
export const Messenger = () => {
  return (
    <Component>
        <Header>
            <Toolbar>

            </Toolbar>
        </Header>
        <Login/>
    </Component>
  )
}
